import React from 'react';
import Location from './location';
import Model from './model';
import Extra from './extra';
import Total from './total';
import Info  from './info';

class Order extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            activeTab: "location"
        }
    }

    toggleTab(tab) {
        this.setState({
            activeTab: tab
        });
    }

    render() {
        let tab
        if (this.state.activeTab == 'location') {
            tab = <Location tab={this.activeTab}/>
        } else if (this.state.activeTab == 'model') {
            tab = <Model tab={this.activeTab}/>
        } else if (this.state.activeTab == 'extra') {
            tab = <Extra tab={this.activeTab}/>
        } else {
            tab = <Total tab={this.activeTab}/>
        }  
        return (
            <div class="order">
               <div class="board-order">
                    {tab}
                </div>
                <Info />
            </div>
        );
    }
}

export default Order;
